import React, { useState, useEffect } from 'react';
import {
  SafeAreaView,
  StyleSheet,
  View,
  Text,
  Pressable,
  Platform,
  Dimensions,
  TextInput,
  useWindowDimensions,
} from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
import { 
  useFonts,
  Orbitron_400Regular,
  Orbitron_500Medium,
  Orbitron_600SemiBold,
  Orbitron_700Bold,
} from '@expo-google-fonts/orbitron';

const App = () => {
  const { width: windowWidth, height: windowHeight } = useWindowDimensions();
  const [isSmallScreen, setIsSmallScreen] = useState(windowWidth < 768);
  const [isMediumScreen, setIsMediumScreen] = useState(windowWidth < 1024);

  // Handle screen size changes
  useEffect(() => {
    setIsSmallScreen(windowWidth < 768);
    setIsMediumScreen(windowWidth < 1024);
  }, [windowWidth]);

  let [fontsLoaded] = useFonts({
    Orbitron_400Regular,
    Orbitron_500Medium,
    Orbitron_600SemiBold,
    Orbitron_700Bold,
  });

  if (!fontsLoaded) {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Loading...</Text>
      </View>
    );
  }

  return (
    <View style={styles.container}>
      <LinearGradient
        colors={['#0A0A0A', '#1a1a2e', '#16213E', '#0A0A0A']}
        style={styles.background}
        start={{ x: 0, y: 0 }}
        end={{ x: 1, y: 1 }}
      />

      <View style={styles.glowContainer}>
        <View style={[
          styles.glowOrb, 
          styles.glowOrb1,
          { width: windowWidth * 0.3, height: windowWidth * 0.3 }
        ]} />
        <View style={[
          styles.glowOrb, 
          styles.glowOrb2,
          { width: windowWidth * 0.4, height: windowWidth * 0.4 }
        ]} />
      </View>

      <SafeAreaView style={styles.content}>
        {/* Responsive Navbar */}
        <View style={[styles.navbar, isSmallScreen && styles.navbarMobile]}>
          <Text style={[styles.logo, isSmallScreen && styles.logoMobile]}>EVE</Text>
          <View style={[styles.navRight, isSmallScreen && styles.navRightMobile]}>
            <Text style={styles.price}>$0.0150</Text>
            <Pressable style={styles.connectButton}>
              <Text style={styles.connectButtonText}>
                {isSmallScreen ? 'Connect' : 'Connect Wallet'}
              </Text>
            </Pressable>
          </View>
        </View>

        {/* Responsive Hero Section */}
        <View style={styles.heroSection}>
          <View style={[styles.heroContent, isSmallScreen && styles.heroContentMobile]}>
            <Text style={[
              styles.heroTitle,
              isSmallScreen && styles.heroTitleMobile,
              isMediumScreen && styles.heroTitleTablet
            ]}>
              Your Personal Agent
            </Text>
            <Text style={[
              styles.heroSubtitle,
              isSmallScreen && styles.heroSubtitleMobile
            ]}>
              Decentralized • Autonomous • Intelligent
            </Text>

            {/* Responsive Chat Window */}
            <View style={[
              styles.chatWindow,
              isSmallScreen && styles.chatWindowMobile
            ]}>
              <View style={styles.chatHeader}>
                <Text style={styles.chatHeaderText}>EVE Assistant</Text>
                <View style={styles.statusIndicator} />
              </View>
              <View style={styles.chatBody}>
                <Text style={styles.placeholderText}>Chat integration coming soon...</Text>
              </View>
              <View style={[
                styles.chatInputContainer,
                isSmallScreen && styles.chatInputContainerMobile
              ]}>
                <TextInput
                  style={styles.chatInput}
                  placeholder="Type your message..."
                  placeholderTextColor="rgba(255, 255, 255, 0.5)"
                />
                <Pressable style={styles.sendButton}>
                  <Text style={styles.sendButtonText}>Send</Text>
                </Pressable>
              </View>
            </View>
          </View>
        </View>
      </SafeAreaView>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  background: {
    position: 'absolute',
    left: 0,
    right: 0,
    top: 0,
    bottom: 0,
  },
  content: {
    flex: 1,
    backgroundColor: 'transparent',
  },
  glowContainer: {
    position: 'absolute',
    width: '100%',
    height: '100%',
    overflow: 'hidden',
  },
  glowOrb: {
    position: 'absolute',
    width: 300,
    height: 300,
    borderRadius: 150,
    opacity: 0.15,
  },
  glowOrb1: {
    backgroundColor: '#00FF9D',
    top: -100,
    right: -50,
    transform: [{ scale: 1.5 }],
  },
  glowOrb2: {
    backgroundColor: '#4D4DFF',
    bottom: -150,
    left: -100,
    transform: [{ scale: 2 }],
  },
  navbar: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: 20,
    borderBottomWidth: 1,
    borderBottomColor: 'rgba(255, 255, 255, 0.1)',
  },
  logo: {
    color: '#fff',
    fontSize: 24,
    fontFamily: 'Orbitron_600SemiBold',
  },
  navRight: {
    flexDirection: 'row',
    alignItems: 'center',
    gap: 20,
  },
  price: {
    color: '#00FF9D',
    fontSize: 16,
    fontFamily: 'Orbitron_400Regular',
  },
  connectButton: {
    backgroundColor: '#00FF9D',
    paddingVertical: 10,
    paddingHorizontal: 20,
    borderRadius: 8,
  },
  connectButtonText: {
    color: '#000',
    fontSize: 14,
    fontFamily: 'Orbitron_500Medium',
  },
  heroSection: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    padding: Platform.select({
      web: '5vw',
      default: 20,
    }),
  },
  heroContent: {
    width: '100%',
    maxWidth: Platform.select({
      web: 1200,
      default: '100%',
    }),
    alignItems: 'center',
  },
  heroTitle: {
    fontSize: 72,
    color: '#fff',
    fontFamily: 'Orbitron_700Bold',
    textAlign: 'center',
    marginBottom: 20,
    textShadowColor: 'rgba(0, 255, 157, 0.3)',
    textShadowOffset: { width: 0, height: 0 },
    textShadowRadius: 20,
  },
  heroSubtitle: {
    fontSize: 24,
    color: '#00FF9D',
    fontFamily: 'Orbitron_400Regular',
    textAlign: 'center',
    marginBottom: 60,
  },
  chatWindow: {
    width: '100%',
    maxWidth: Platform.select({
      web: 800,
      default: '100%',
    }),
    height: Platform.select({
      web: 500,
      default: '70vh',
    }),
    minHeight: 400,
    backgroundColor: 'rgba(0, 255, 157, 0.05)',
    borderRadius: 16,
    borderWidth: 1,
    borderColor: '#00FF9D',
    overflow: 'hidden',
    backdropFilter: 'blur(10px)',
    ...Platform.select({
      web: {
        backdropFilter: 'blur(10px)',
      },
    }),
  },
  chatHeader: {
    flexDirection: 'row',
    alignItems: 'center',
    padding: 20,
    borderBottomWidth: 1,
    borderBottomColor: 'rgba(0, 255, 157, 0.2)',
    backgroundColor: 'rgba(0, 255, 157, 0.1)',
  },
  chatHeaderText: {
    color: '#fff',
    fontSize: 18,
    fontFamily: 'Orbitron_500Medium',
    marginRight: 10,
  },
  statusIndicator: {
    width: 8,
    height: 8,
    borderRadius: 4,
    backgroundColor: '#00FF9D',
  },
  chatBody: {
    flex: 1,
    padding: 20,
    justifyContent: 'center',
    alignItems: 'center',
  },
  placeholderText: {
    color: 'rgba(255, 255, 255, 0.5)',
    fontFamily: 'Orbitron_400Regular',
    fontSize: 16,
  },
  chatInputContainer: {
    flexDirection: 'row',
    padding: 20,
    borderTopWidth: 1,
    borderTopColor: 'rgba(0, 255, 157, 0.2)',
    backgroundColor: 'rgba(0, 0, 0, 0.3)',
  },
  chatInput: {
    flex: 1,
    height: Platform.select({
      web: 40,
      default: 44,
    }),
    paddingHorizontal: Platform.select({
      web: 15,
      default: 10,
    }),
    backgroundColor: 'rgba(255, 255, 255, 0.1)',
    borderRadius: 8,
    marginRight: 10,
    color: '#fff',
    fontFamily: 'Orbitron_400Regular',
  },
  sendButton: {
    backgroundColor: '#00FF9D',
    paddingHorizontal: Platform.select({
      web: 20,
      default: 15,
    }),
    borderRadius: 8,
    justifyContent: 'center',
    alignItems: 'center',
    height: Platform.select({
      web: 40,
      default: 44,
    }),
  },
  sendButtonText: {
    color: '#000',
    fontFamily: 'Orbitron_500Medium',
    fontSize: 14,
  },
  // Responsive styles
  navbarMobile: {
    padding: 15,
    flexDirection: 'column',
    gap: 15,
  },
  logoMobile: {
    fontSize: 20,
  },
  navRightMobile: {
    width: '100%',
    justifyContent: 'space-between',
  },
  heroContentMobile: {
    padding: 15,
  },
  heroTitleMobile: {
    fontSize: 36,
    marginBottom: 15,
  },
  heroTitleTablet: {
    fontSize: 54,
  },
  heroSubtitleMobile: {
    fontSize: 18,
    marginBottom: 30,
  },
  chatWindowMobile: {
    height: 400,
    maxWidth: '100%',
  },
  chatInputContainerMobile: {
    padding: 15,
  },
});

export default App;
